import React, {useState, useEffect} from "react"
import { DataGrid } from "@material-ui/data-grid";

function Table() {

  const proxyURL = "https://cors-anywhere.herokuapp.com/"
  const [rowDate, setRowData] = useState([])

  useEffect(() => {
    const targetURL = "https://disease.sh/v3/covid-19/countries"
    const getCountries = async () => {
      await fetch(proxyURL + targetURL)
      .then(response => response.json())
      .then(data => {
        var id = 1
        setRowData(data.map(country => ({
          id: id++,
          countryName: country.country,
          cases: country.cases
        })))
      })
    }
    getCountries()
  }, [])


  const columns = [
    { field: 'id', headerName: 'ID', width: 50 },
    { field: 'countryName', headerName: 'Country', type: 'number', width: 130 },
    { field: 'cases', headerName: 'Cases', width: 130 },
  ];

  const rows = [
    { id: 1, countryName: 'Snow', cases: 13234},
    { id: 2, countryName: 'Lannister', cases: 3434},
    { id: 3, countryName: 'Lannister', cases: 212},
    { id: 4, countryName: 'Stark', cases: 24434533},
    { id: 5, countryName: 'Targaryen', cases: 31323},
    { id: 6, countryName: 'Melisandre', cases: 23131},
    { id: 7, countryName: 'Clifford', cases: 3131},
  ];


  return (
    <div style={{ height: 400, width: '100%' }}>
      <DataGrid rows={rowDate} columns={columns} pageSize={6} checkboxSelection />
    </div>
  )
}

export default Table
